import React from "react";

const Projects = ({ data }) => {
  if (data) {
    var projects = data.map((project)=>{
      return (
        <section className="project">
          <h1>{project.title}</h1>
          <img/>
        </section>
      )
    })
  }

  return (
    <section id="projects">
      {projects}
    </section>
  );
};

export default Projects;
